import React, { useState } from 'react';
import SpaceCard from '../components/SpaceCard';

const spaces = [
  { id: 1, name: 'Garage Espacioso', location: 'Ciudad de México', price: 100, image: 'https://via.placeholder.com/400x300' },
  { id: 2, name: 'Almacén Seguro', location: 'Guadalajara', price: 150, image: 'https://via.placeholder.com/400x300' },
  { id: 3, name: 'Espacio Premium', location: 'Monterrey', price: 200, image: 'https://via.placeholder.com/400x300' },
];

const Home = () => {
  const [search, setSearch] = useState('');
  const [priceRange, setPriceRange] = useState([0, 300]);

  const filteredSpaces = spaces.filter(
    (space) =>
      space.name.toLowerCase().includes(search.toLowerCase()) &&
      space.price >= priceRange[0] &&
      space.price <= priceRange[1]
  );

  return (
    <div className="container mx-auto p-8">
      <h1 className="text-3xl font-bold mb-6 text-center">Encuentra tu espacio ideal</h1>

      {/* Filtros */}
      <div className="flex justify-between items-center mb-6">
        <input
          type="text"
          placeholder="Buscar por ubicación"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="border rounded p-2 w-full max-w-xs"
        />
        <div className="flex items-center gap-4">
          <span>Rango de precios:</span>
          <input
            type="range"
            min="0"
            max="300"
            value={priceRange[1]}
            onChange={(e) => setPriceRange([0, Number(e.target.value)])}
            className="w-40"
          />
          <span>${priceRange[1]}</span>
        </div>
      </div>

      {/* Lista de Espacios */}
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
        {filteredSpaces.map((space) => (
          <SpaceCard key={space.id} space={space} />
        ))}
      </div>
    </div>
  );
};

export default Home;
